import React from 'react';

const Tweet = ({tweets}) => (
    <div>
        {tweets.map((thistweet, key) => 
        <div className="tweet" key={key}>
            <p>ID {thistweet.id}</p>
            <p>{thistweet.text}</p> 
            {thistweet.tweets.map((user, key) =>
            <div key={key}>{user.name}</div>

            )}
        </div> 
        )}
    </div>       
)

export default Tweet;
